import React from "react";
import Separtor from "./Separator";

const OverlapDiv=()=>{
    return(
        <div style={{
            backgroundColor:"black",
            width:"90%",
            height:"70px",
            margin:"auto",
            position:"relative",
            top:"-150px",
            borderRadius:"60px",
            paddingTop:"0.5%"
        }}>
        <Separtor/>
        </div>
    )
}

export default OverlapDiv;
